richedit.FN_GET_APPINF	= function (e) {
	var pParam	= e.getAttribute(richedit.E_PLUGIN_NM);

	latte.Logger.info(richedit.E_PLUGIN_NM+'="'+pParam+'"');
	try {
		if (!pParam) throw new Error('플러그인 설정이 잘못 되었습니다.');

		var pNms	= pParam.split(/-/);
		var pNSNm	= pNms[0].split(/\./);
		if (pNSNm.length != 2) throw new Error('플러그인 설정이 잘못 되었습니다.');

		var dParam	= e.getAttribute(richedit.E_DATA_NM);
		var dHotKey	= e.getAttribute(richedit.E_HOTKEY_NM);
		if (!richedit[pNSNm[0]]) throw new Error('"richedit.'+pNSNm[0]+'"은(는) 객체가 아닙니다.');
		if (!richedit[pNSNm[0]][pNSNm[1]]) throw new Error('"richedit.'+pNSNm[0]+'.'+pNSNm[1]+'"은(는) Class가 아닙니다.');

		return {
			cApp	: richedit[pNSNm[0]][pNSNm[1]],
			pID		: pNSNm[1],
			eID		: pNms[1] || null,
			dat		: dParam ? latte.json.parse(dParam) : {},
			hot		: dHotKey ? eval(dHotKey) : []
		};

		return rtnVal;
	}
	catch (e) { latte.Logger.error('richplugin 설정오류', e); }

	return null;
}

